        function filter(areas) {  //areas是我的點選值
            var allcity = document.querySelectorAll('.card')
            allcity.forEach(elallcity => {
                if (areas == 'all') {           //當我點選值是'all'時
                    elallcity.style.display = 'flex';
                    main.classList.add('scroll');
                } else {
                    elallcity.style.display = 'none';                 //當我沒點選除了’all‘以外的點選值
                    main.classList.remove('scroll');
                    areas.forEach(elareas => {  //areas每筆資料for迴圈核對
                        if (elallcity.dataset.city == elareas) { //如果網域外每筆資料的城市名有符合areas地區內的陣列字串時
                            elallcity.style.display = 'flex';                   //回傳該筆網域外資料
                        }
                    });
                }
            });
        }

        function find(citys) {                              //citys => 地圖的每一個區塊的值
            var allcity = document.querySelectorAll('.card')
            main.classList.remove('scroll');
            allcity.forEach(elallcity => {                  //alallcity => 每張卡片
                elallcity.style.display = 'none';           //全部卡片關閉
                if (elallcity.dataset.city == citys) {
                    elallcity.style.display = 'flex'        //打開對應的地區
                }
            });
        }


